      <h1 className="heading">My Contacts</h1>
      <Avatar img={contacts[0].imgURL} />
      {contacts.map(function(contact){
        return  <Card name={contacts.name} img={contacts.imgURL} tel={contacts.phone} email={contacts.email}/>
